export const WORK_EXPERIENCE = [
    {
        title: "Software Engineer",
        company: "Yext",
        date: "May 2023 - June 2024",
        responsibilities: [
            "Utilized React, TypeScript, and Tailwind CSS to develop highly responsive websites with pixel-perfect implementations of Figma UI designs for Fortune 500 clients.",
            "Designed ETL data connections from third parties to Yext’s platform to streamline the automated loading and updating of data from client sources using Go and MySQL.",
            "Implemented WCAG 2.1 AA compliance standards and optimized page speed, achieving scores of 90+.",
            "Trained and mentored new hires on React, Google Closure, and the Yext Platform during their three-month onboarding process.",
        ],
    },
    {
        title: "Software Development Engineer Intern",
        company: "Amazon",
        date: "May 2021 - August 2021",
        responsibilities: [
            "Worked with the AWS S3 User Security Management team to automate the Zelkova Backfill Notification system whenever there were updates to S3 bucket security policies.",
            "Used AWS Lambda, Simple Queue Service, and CloudFormation to reduce existing manual notification process from hours to minutes.",
            "Completed a Machine Learning course about Tabular Data through the company.",
        ],
    },
    {
        title: "Software Developer Intern",
        company: "Vidoori Inc.",
        date: "June 2020 - August 2020",
        responsibilities: [
            "Created an administrative console web application for the company’s load testing tool, VPT.",
            "Primarily worked in front-end development (HTML/Angular/TypeScript/Node.js) and UI Design (Figma).",
            "Worked in an Agile/Scrum environment using Jira on a team with three other interns.",
        ],
    },
    {
        title: "Information Technology Intern",
        company: "Vidoori Inc.",
        date: "July 2019 - August 2019",
        responsibilities: [
            "Tested a web application that documents and manages all the software and hardware assets of the company.",
            "Utilized various Quality Assurance (QA) methodologies including compatibility testing, user acceptance testing (UAT), and unit testing.",
        ],
    },
];
